const reservedKitty = [
  {
    totalPlayer: 3,
    baseKitty: 4000,
    category: 'A',
  },
  {
    totalPlayer: 2,
    baseKitty: 3000,
    category: 'B',
  },
  {
    totalPlayer: 5,
    baseKitty: 2000,
    category: 'C',
